create table geocountries
(
    ISO                varchar(255)  not null
        primary key,
    fipsCountryCode    varchar(255)  null,
    ISO3               varchar(255)  null,
    ISONumeric         varchar(255)  null,
    CountryName        varchar(255)  null,
    Capital            varchar(255)  null,
    GeoNameID          int           null,
    Area               varchar(255)  null,
    Population         int           null,
    Continent          varchar(255)  null,
    TopLevelDomain     varchar(255)  null,
    CurrencyCode       varchar(255)  null,
    CurrencyName       varchar(255)  null,
    PhoneCountryCode   varchar(255)  null,
    Languages          varchar(255)  null,
    PostalCodeFormat   varchar(255)  null,
    PostalCodeRegex    varchar(255)  null,
    Neighbours         varchar(255)  null,
    CountryDescription longtext      null,
    Heat               int default 0 null
)
    charset = utf8;

create index CurrencyCode
    on geocountries (CurrencyCode);

create index GeoNameID
    on geocountries (GeoNameID);

